import './App.css';
import Form from './components/Form';
import {done} from './components/Form'

function App() {

  const finished = () => {
    if (done === true){
      return
    }
    else {
      return (
        <Form />
      )
    }
  }
  return (
    <div className="App">
      {finished()}
    </div>
  );
}

export default App;
